sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {

  var incidentSate;
  var query;

  incidentSate = api.state.incidentSate;
  query = '';

  if (incidentSate)
    query += 'stateIN' + api.state.incidentSate;

	return query;
}
